import {connect} from "react-redux";

const isLogged = (props) => {
    const {token} = props;
    if (token) {
        return true;
    }
    return false;
}

const mapStateToProps = (state) => (
{
    'token': state.token,
});

export default connect(mapStateToProps)(isLogged);
